import React from 'react';
import SlotM from './SlotM';

const App = () => {
    return (
        <>
            <h1 style = {{ textAlign:'center'}} > Welcome to <span style = {{color:'red' }} >Slot Machine</span></h1>
            <SlotM icon1 = '@' icon2 = '@' icon3 = '@' />
            <SlotM icon1 = '@' icon2 = '#' icon3 = '@' />
            <SlotM icon1 = '@' icon2 = '#' icon3 = '$' />
        </>
    );
};

export default App;
